<?php
class Tfingerprints extends MpiController {
  var $skip_before_action = "*";
  var $display_value;

  function init(){
    parent::init();
    $scope = Scope::find(2);
    $this->display_value = new DisplayValue($scope);
  }

  function match(){
    $test_fp =   "";

    $fps = array(
      "kjkjkj",
      "fdafdafdafdafda",
      "",
      "",
      "",
    );
    $sdk = GrFingerService::get_instance();
    ILog::d("Fingerprint obj", $sdk);
    if(!$sdk->prepare($test_fp))
      die("failed");

    foreach($fps as $index => $fp){
      if(!$sdk->prepare($fp))
        ILog::d("can not prepare ", $index);
    }
    $sdk->prepare($test_fp);

    foreach($fps as $index => $fp){
      if($sdk->identify($fp))
        ILog::d("Index ", $index);
    }

  }
}
